import React from "react"

function Main(props){

    const noviFilm=props.state.roles === "ROLE_ADMIN " && <NoviFilm />
    const users=props.state.roles === "ROLE_ADMIN " && <Users />
    return(
        <div id="main">
            <Filmovi />
            {noviFilm}
            {users}
            <Registracija/>
        </div>
    )
}

export default Main
